INSERT INTO `lab` (`ID_Lab`, `Nama_Lab`, `Sejarah`, `Fasilitas`, `Kompetensi`, `Lokasi`) VALUES
(1, 'Sistem Informasi', 'Teknik Informatika PENS memiliki salah satu Lab yang bernama Lab Sistem Informasi, Lab ini didirikan pada tanggal 2 Juni 2000. Lab ini berada di lantai 1 gedung D4 yang lebih tepatnya pada ruang C102. Lab ini di dirikan untuk menunjang beberapa mata kuliah yang ada di Teknik Informatika', '31 Komputer Built-up Core 2 Duo\n1 LCD\n16 UPS\nOS : Windows XP Proffesional\n\n', 'Lab ini digunakan untuk beberapa praktikum yaitu yang ada pada daftar mata kuliah. Lab ini bisa digunakan untuk penelitian yang digunakan oleh dosen-dosen serta mahasiswa yang sedang meneliti sesuai dengan mata kuliah yang ada.\r\nMata Kuliah', 'C102'),
(2, 'Basis Data', 'Teknik Informatika PENS memiliki salah satu Lab yang bernama Lab Basis Data, Lab ini didirikan pada tanggal 2 Juni 2000. Lab ini berada di lantai 1 gedung D4 yang lebih tepatnya pada ruang C105. Lab ini di dirikan untuk menunjang beberapa mata kuliah yang ada di Teknik Informatika', '31 Komputer Built-up Core 2 Duo\r\n1 LCD, 16 UPS\r\nSoftware RDBMS : Microsoft Access dan Oracle Server\r\nOS : Windows XP Proffesional\r\nTool Pengembangan : Microsoft.Net\r\n\r\n', 'Lab ini digunakan untuk beberapa praktikum yaitu yang ada pada daftar mata kuliah. Lab ini bisa digunakan untuk penelitian yang digunakan oleh dosen-dosen serta mahasiswa yang sedang meneliti sesuai dengan mata kuliah yang ada.', 'C105'),
(4, 'Sistem Informasi Geografi', 'Teknik Informatika PENS memiliki salah satu Lab yang bernama Lab GIS, Lab ini didirikan pada tanggal 2 Juni 2000. Lab ini berada di lantai 1 gedung D4 yang lebih tepatnya pada ruang C203. Lab ini di dirikan untuk menunjang beberapa mata kuliah yang ada di Teknik Informatika', '\r\n31 Komputer Built-up Core 2 Duo\r\n1 LCD, 16 UPS\r\nSoftware RDBMS : Microsoft Access dan Oracle Server\r\nOS : Windows XP Proffesional\r\nTool Pengembangan : Microsoft.Net\r\n\r\n', 'Lab ini digunakan untuk beberapa praktikum yaitu yang ada pada daftar mata kuliah. Lab ini bisa digunakan untuk penelitian yang digunakan oleh dosen-dosen serta mahasiswa yang sedang meneliti sesuai dengan mata kuliah yang ada.', 'C203'),
(6, 'Computer Vision', 'Lab ini digunakan untuk beberapa praktikum yaitu yang ada pada daftar mata kuliah. Lab ini bisa digunakan untuk penelitian yang digunakan oleh dosen-dosen serta mahasiswa yang sedang meneliti sesuai dengan mata kuliah yang ada.', '31 Computer Macintosh', 'Lab ini digunakan untuk beberapa praktikum yaitu yang ada pada daftar mata kuliah. Lab ini bisa digunakan untuk penelitian yang digunakan oleh dosen-dosen serta mahasiswa yang sedang meneliti sesuai dengan mata kuliah yang ada.', 'C303'),
(7, 'Soft Computing', 'Teknik Informatika PENS memiliki salah satu Lab yang bernama Lab Soft Computing, Lab ini didirikan pada tanggal 2 Juni 2000. Lab ini berada di lantai 1 gedung D4 yang lebih tepatnya pada ruang C205. Lab ini di dirikan untuk menunjang beberapa mata kuliah yang ada di Teknik Informatika', '31 Komputer Built-up Core 2 Duo\r\n1 LCD, 16 UPS\r\nSoftware R: Licensed Matlab\r\nOS : Windows XP Proffesional\r\n\r\n', 'Lab ini digunakan untuk beberapa praktikum yaitu yang ada pada daftar mata kuliah. Lab ini bisa digunakan untuk penelitian yang digunakan oleh dosen-dosen serta mahasiswa yang sedang meneliti sesuai dengan mata kuliah yang ada.', 'C205'),
(8, 'Jaringan Komputer', 'Teknik Informatika PENS memiliki salah satu Lab yang bernama Lab Jaringan Komputer, Lab ini didirikan pada tanggal 2 Juni 2000. Lab ini berada di lantai 1 gedung D4 yang lebih tepatnya pada ruang C307. Lab ini di dirikan untuk menunjang beberapa mata kuliah yang ada di Teknik Informatika', 'Switching Hub\r\nCISCO Partner\r\nDigital Audio Processor\r\nAudio Mixer\r\nLAN Analyzer\r\nPersonal Computer\r\nLinux server\r\nPrinter Server\r\nSun Spare Server\r\nLCD Projector\r\nDigital Audio Tape\r\nRecorder\r\nADAMS Series\r\nWireless LAN \r\n\r\n', 'Lab ini digunakan untuk beberapa praktikum yaitu yang ada pada daftar mata kuliah. Lab ini bisa digunakan untuk penelitian yang digunakan oleh dosen-dosen serta mahasiswa yang sedang meneliti sesuai dengan mata kuliah yang ada.', 'C305');

